{
  "name": "svelte-shiny-python",
  "private": true,
  "version": "0.0.0",
  "type": "module",
  "scripts": {
    "dev": "vite",
    "build": "vite build",
    "preview": "vite preview"
  },
  "devDependencies": {
    "@sveltejs/vite-plugin-svelte": "^1.1.0",
    "carbon-components-svelte": "^0.70.12",
    "carbon-preprocess-svelte": "^0.9.1",
    "svelte": "^3.52.0",
    "svelte-preprocess": "^4.10.7",
    "vite": "^3.2.3"
  },
  "dependencies": {
    "@types/rstudio-shiny": "https://github.com/rstudio/shiny#v1.7.1"
  }
}

import sveltePreprocess from "svelte-preprocess";
import { optimizeImports } from "carbon-preprocess-svelte";

export default {
  preprocess: [sveltePreprocess(), optimizeImports()],
};

import { defineConfig } from "vite";
import { svelte } from "@sveltejs/vite-plugin-svelte";

// https://vitejs.dev/config/
export default defineConfig({
  plugins: [svelte()],
  build: {
    outDir: "./dist/www",
    assetsDir: "build",
    rollupOptions: {
      output: {
        entryFileNames: `build/[name].js`,
        chunkFileNames: `build/[name].js`,
        assetFileNames: `build/[name].[ext]`,
      },
    },
  },
});

import App from "./App.svelte";

if (import.meta.env.MODE === "production") {
  $(document).on("shiny:sessioninitialized", function (event) {
    new App({
      target: document.getElementById("app"),
    });
  });
} else {
  new App({
    target: document.getElementById("app"),
  });
}

// export default app;

const penguinData = {
  bill_length_mm: { min: 32, max: 59 },
  flipper_length_mm: { min: 172, max: 231 },
  body_mass_g: { min: 2700, max: 6300 },
  sex: { min: 0, max: 1 },
};

export default penguinData;
